  input: 'TEXT,F3A,,"Our reply to your notice on August 24, 2004.Reference: Amended
    12 Day Pre-Primary Report (7/1/04-7/14/04) received 8/13/04. We had to amend the
    Pre-Primary report showing $16.98 more in operating expenditures and $45,000 in
    other disbursements than on the original Pre-Primary report.  The mistake was
    found when we balanced with the bank statement for July the first week of August.  Unfortunately,
    the person issuing the three checks (one was for $45,000 to the Missouri Republican
    Party which was  a ''Transfer to affiliated/authorized committee,'' did not transmit
    the information to the data entry person and the data entry person did not check
    the check book to ensure that all checks had been entered into the system.  We
    regret our mistake and have set down better procedures before filing the FEC report
    in the future. It was a true mistake as Congressman Akin doesn''t have an opponent
    for the primary so we weren''t trying to hide anything from the pre-primary report.  Scott
    Engelbrecht, Treasurer"'
